using Shared;
using System;
using System.Text;

namespace Day5
{
    class Program
    {
        static void Main(string[] args)
        {
            var input = "";

            var reacted = React(input);

            IO.WriteLine($"length {reacted.Length}");

            var min = int.MaxValue;
            var minC = '-';
            for (var c = 'A'; c <= 'Z'; ++c)
            {
                var sb = new StringBuilder(input);
                for (var i = 0; i < sb.Length; ++i)
                {
                    if (char.ToUpper(sb[i]) == char.ToUpper(c))
                    {
                        sb.Remove(i, 1);
                        --i;
                    }
                }
                var rLength = React(sb.ToString()).Length;
                if (rLength < min)
                {
                    min = rLength;
                    minC = c;
                }
            }

            IO.WriteLine($"min {min} char {minC}");
        }

        private static string React(string s)
        {
            var sb = new StringBuilder(s);

            var changed = false;
            do
            {
                changed = false;
                for (var i = 0; i < sb.Length - 1; ++i)
                {
                    if (char.ToUpper(sb[i]) == char.ToUpper(sb[i + 1]) && sb[i] != sb[i + 1])
                    {
                        sb.Remove(i, 2);
                        changed = true;
                    }
                }
            }
            while (changed);

            return sb.ToString();
        }
    }
}
